import React from 'react';
import { Container, Box, Typography, Button } from '@material-ui/core';

/**
 * MyPortfolio
 * @Author Holland Aucoin
 * 
 * About Contact
 * @Summary This component displays a contact call to action on the about page
 */

export default function App() {

  return (

    <section>
        <Container maxWidth="md">
            <Box py={8} textAlign="center">
            <Typography variant="h3" component="h2" gutterBottom={true}>Want to connect?</Typography>
            <Box mt={4}>
                <Button variant="outlined" size="large" color="primary">Contact me</Button>
            </Box>
            </Box>
        </Container>
    </section>
  )
}
